import styled from 'styled-components';

const Label1 = styled.h1`
margin-left: .8%;
margin-top: .1%;
font-size: 175%;
text-align: left;
font-weight: normal;
`

const Container = styled.div`
position: absolute;
margin-top: 20px;
top: 300px;
width: 100%;
height: 50%;
border-bottom: 2px solid black;
border-top: 2px solid black;
`

const IntervalBOX = styled.div`
position: absolute;
bottom: 0%;
left: 0%;
height: 90%;
width: 95%;
border-top: 3px solid black;
border-right: 3px solid black;
overflow: hidden;
overflow-x: scroll;

`
const IntervalContainer = styled.div`
position: absolute;
bottom: 0%;
left: 0%;
height: 100%;
width: 100%;

overflow: hidden;
overflow-x: scroll;

`

const IntervalCard = styled.div`
width: 200px;
height: 100%;
border-right: 2px solid black;
display: inline-block;

`


const ParkwideIntervals= () => {
    return (
        <Container>
            <Label1>Parkwide Intervals</Label1>
            <IntervalBOX>
            <IntervalContainer>
                <IntervalCard>hi</IntervalCard>
                <IntervalCard>hi</IntervalCard>
                <IntervalCard>hi</IntervalCard>
                <IntervalCard>hi</IntervalCard><IntervalCard>hi</IntervalCard><IntervalCard>hi</IntervalCard><IntervalCard>hi</IntervalCard><IntervalCard>hi</IntervalCard>
            </IntervalContainer>
            </IntervalBOX>
        </Container>
    )
}

export default ParkwideIntervals
